import background from './Utils/images/rename.jpg'

import "bootstrap/dist/css/bootstrap.min.css";
import { Card, Col, Container, Row } from "react-bootstrap";
import Navi from "./components/Navi";


function App() {
  return (
<Container fluid='true'>
  <Navi/>
<Container fluid='true' style={{backgroundImage: `url(${background})`, backgroundSize: 'cover', height:1300}}>
  <Row className='justify-content-center'>
    <div className='card' style={{width:'33%', height: 400, opacity:'.35', marginTop:'10%'}}>
      <div className='card-body'>
      <p style={{color:"black", opacity:'1', paddingTop:'20%', fontSize:42}} className='align-middle text-center fw-bold'>Joshua Coleman</p>
      <p className='text-center card-subtitle'>FULLSTACK WEB DEVELOPER</p>
      </div>

    </div>



  </Row>


 </Container>
 </Container>






  );
}

export default App;
